(defn dist-theo [{:keys [restricted-weights v-biases h-biases]}]
  (let [ev-rbm (create-theoretical-rbm restricted-weights v-biases h-biases)]
    (reduce (fn [f s] (update-in f [s] 
                             (fnil + 0)
                             (f/prob-visi ev-rbm s)))
        {}
     (f/state-space 9))))
